import React, { useState } from "react";
import { Modal } from "@mui/material";

const StateModal = ({ open, handelStateModalClose, item, selectItem }) => {
  return (
    <Modal
      open={open}
      style={{
        height: "100%",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          background: "white",
          height: 150,
          width: 300,
          padding: 10,
          borderRadius: 10,
        }}
      >
        <div style={{ flex: 8 }}></div>
        <div style={{ flex: 2 }}></div>
        <h2>Modal Content</h2>
        <p>{selectItem}</p>
        {/* {item.map((items, i) => {
          console.log(items);
          return <p>{("tete", items.name)}</p>;
        })} */}
        <button
          style={{
            border: "none",
            background: "none",
            color: "red",
            marginTop: 10,
          }}
          onClick={handelStateModalClose}
        >
          X
        </button>
      </div>
    </Modal>
  );
};
export default StateModal;
